</style></head><body><div class="Section0"><p style="text-align:center;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:107.916664%;margin-top:0pt;margin-bottom:8pt;"><span lang="en-US" style="color:#FF0000;font-family:Arial;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;line-height:107.916664%;">WARNING</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span lang="en-US" style="color:#FF0000;font-family:Arial;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">• The stabilator may fail without illumination of the associated caution and aural warning tone. Initial indication of failure may be an uncommanded pitch change during accelerated or decelerated flight.</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span lang="en-US" style="color:#FF0000;font-family:Arial;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">• If accelerated flight is continued with the stabilator in the full down position, longitudinal control will be lost.</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span lang="en-US" style="color:#FF0000;font-family:Arial;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">• With the stabilator fixed at or near 0°, nose-high attitudes may occur at slow speeds.</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span lang="en-US" style="color:#FF0000;font-family:Arial;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">• A combination of high airspeed/low altitude coupled with a runaway down stabilator will necessitate immediate pilot action to maintain control of the aircraft.</span></p>
