<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span lang="en-US" style="color:#FF0000;font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">• Do not inflate LPU until outside helicopter.</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span style="color:#FF0000;font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">&#xa0;</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span lang="en-US" style="color:#FF0000;font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">• Water pressure may prevent opening the emergency egress windows until the cabin fills with water. The windows should be jettisoned prior to water entry to optimize the ability of the crew to safely egress.</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span style="color:#FF0000;font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">&#xa0;</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span lang="en-US" style="color:#FF0000;font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">• Failure to disconnect ICS cord can impede egress. Personal gear may snag during egress, notably on collectives, HCUs, parking brake and RAST release handles, PCLs/Fuel Selectors/Fire T–Handles, or extended window emergency jettison handles.</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span style="color:#FF0000;font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">&#xa0;</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span lang="en-US" style="color:#FF0000;font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">• If entanglement or disorientation delays egress, hold onto a reference point with one hand. Using the other hand, place the Emergency Breathing Device second stage regulator in your mouth, clear water from your mouthpiece, and continue with egress.</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span style="color:#FF0000;font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:normal;font-style:normal;font-variant:normal;">&#xa0;</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span lang="en-US" style="font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:bold;font-style:normal;font-variant:normal;">*1. Emergency Breathing Device — As required.</span></p>
<p style="text-align:left;page-break-inside:auto;page-break-after:auto;page-break-before:avoid;line-height:normal;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:Times New Roman;font-size:10pt;text-transform:none;font-weight:bold;font-style:normal;font-variant:normal;">&#xa0;</span></p>
