const minplanfuelhtml = """ <p>Minimum planned fuel on landing shall be no less than 600 pounds.</p>""";
const apulimithtml = """<p>The APU is not intended for routine in-flight use. Operation of the APU in flight shall be limited to essential operations only. Acceptable in-flight use includes emergency procedures, single-engine training, practice autorotations, and powering the ECS during extreme temperature operations.</p>""";
const xmsnlimithtml = """<p>The transmission is limited by Nr, torque, oil pressure, and oil temperature (Figure 4-1). Operation is governed by whichever limit is reached first.</p>
<p align="center"><strong>Note</strong></p>
<p align="center">Engine torques over 150% are displayed as red &ldquo;XXX.&rdquo;</p> """;
const xmsnoiltemplimithtml = """ <p>During any operating condition, no maintenance action is required if main transmission oil temperature is in the precautionary range continuously for 5 minutes or less. Prolonged Hovering in hot weather, 86 &deg;F (30 &deg;C), may cause main transmission oil temperature to rise into the precautionary range. Operation in the precautionary range for less than 30 minutes during any one flight under this condition is acceptable and no maintenance action is required.</p>""";
const xmsnoilpreslimithtml = """<p>During steady-state level pitch attitudes (i.e., level flight), the transmission oil pressure should be 45 to 60 psi. The following conditions do not constitute an immediate emergency situation, but may be indicative of a degraded lubrication system. Any discrepancy shall be documented on a Maintenance Action Form (MAF).</p>
<p>&nbsp;</p>
<p>1. Steady pressure outside of 45 to 60 psi, but within the normal limits of 30 to 65 psi.</p>
<p>2. Fluctuations not to exceed a range of 10 psi, within the normal limits of 30 to 65 psi.</p>
<p>&nbsp;</p>
<p>During transient pitch or steady-state nose-high pitch attitudes (autorotations, downwind hovering, rearward flight, slope-up landings, etc.) transmission oil pressure fluctuations (including momentary fluctuations below 30 psi and transient drops below 20 psi for up to one second) are acceptable. Operating with pressure fluctuations below 30 psi shall be limited to 30 minutes.</p>
<p>&nbsp;</p>
<p>During rotor engagement, a zero oil pressure indication may indicate a no-oil-flow condition through the oil lubrication system. Operating with a no oil pressure indication shall be limited to less than 1 minute and shall be documented on a Maintenance Action Form (MAF).</p> """;
const rotorenglimithtml = """<p>Maximum wind velocity for rotor engagement or disengagement is 45 knots from any direction.</p> """;
const airspeedlimithtml = """ <p>Airspeed is limited as follows:</p>
<p>1. Maximum (Vne) — 180 KIAS.</p>
<p>2. Maximum as limited by blade stall — Refer to Figure 22-3.</p>
<p>3. Sideward/rearward flight — 35 knots.</p>
<p>4. Autorotation — 100 KIAS.</p>
<p>5. Boost off — 140 KIAS.</p>
<p>6. SAS 1 and SAS 2 inoperative in IMC — 125 KIAS.</p>
<p>7. Either PRI SERVO PRESS caution — 125 KIAS.</p>
<p>8. Searchlight in fixed position other than stowed — 160 KIAS.</p>
<p>9. Searchlight in transition — 100 KIAS.</p>
<p>10. Dome at or above trail (cable extended 10 feet, dome approximately 6 feet below aircraft) — 70 KIAS, 45° AOB. Dome below trail — 70 KIAS, 15° AOB.</p>
<p>11. Cabin door opening/closing — 60 KIAS.</p>
<p align="center"><span style="color: #008000;"><strong>Note</strong></span></p>
<p style="text-align: left;" align="center"><span style="color: #008000;">• With cabin door open, uncoordinated flight should be avoided.</span></p>
<p style="text-align: left;" align="center"><span style="color: #008000;">• With MTS installed, failure to maintain balanced flight below 90 KIAS in </span><span style="color: #008000;">descents over 1,000 fpm will result in inaccurate and erratic airspeed indications</span>.</p>
<p align="center"> </p>""";
const minhtsagelandengfailhtml = """ <p>The height-velocity diagrams (Figure 27-7) show the combinations of speed and wheel height that should be avoided during normal operations to provide for safe landing if single- or dual-engine failure should occur. Delay in recognition of the single-engine failure or excessive maneuvering to reach a suitable landing area reduce the probability of a safe touchdown.</p>""";
const maneuverlimithtml = """ <p>Limitations for maneuvering with external loads and rescue hoist loads are presented in Figure 4-4. Rate of descent is limited to 1,000 fpm for rescue hoist loads.</p>
<p align="center">Figure 4-4. External Load and Rescue Hoist Load Maneuvering Limitations</p>
<p align="center">&nbsp;<img src="data:image/png;base64," alt="" /></p>""";
const hoveringlimithtml = """<p>1. Prolonged rearward flight and downwind hovering should be avoided to prevent accumulation of exhaust fumes in the helicopter and heat damage to the window on an open cabin door.</p>
<p>2. Hovering turns at a rate in excess of 30&deg; per second.</p>
<p>3. Dipping sonar operations at altitudes other than 70 feet.</p>
<p>&nbsp;</p>
<p align="center"><span style="color: #ffcc00;"><strong>Caution</strong></span></p>
<p align="center"><span style="color: #ffcc00;"><strong>&nbsp;</strong></span></p>
<p><span style="color: #ffcc00;">Deviation of aircraft hover altitude from 70 feet while transducer assembly is entering or exiting the water may result in damage to the dipping sonar equipment due to electrostatic discharge.</span></p>
<p><span style="color: #ffcc00;">&nbsp;</span></p>
<p><span style="color: #003300;">4. Do not tow the transducer in the water above 8 KGS with array folded and 4 KGS with array unfolded.</span></p>
<p><span style="color: #ffcc00;">&nbsp;</span></p>
<p align="center"><span style="color: #ffcc00;"><strong>Caution</strong></span></p>
<p align="center"><span style="color: #ffcc00;"><strong>&nbsp;</strong></span></p>
<p><span style="color: #ffcc00;">Exceeding 8 KGS with array folded or 4 KGS with array unfolded may cause TA cable separation.</span></p>
<p>&nbsp;</p>
<p align="center"><span style="color: #339966;"><strong>Note</strong></span></p>
<p align="center"><span style="color: #339966;"><strong>&nbsp;</strong></span></p>
<p><span style="color: #339966;">Towing is defined as the cable contacting the funnel. Aircraft ground speed may be greater than 8 KGS (folded) or 4 KGS (unfolded) provided the cable is not in contact with the funnel.</span></p>
<p align="center">&nbsp;</p>""";
